(2,	'public',	'repost',	'转发微博',	'&lt;title&gt;&lt;![CDATA[{$actor} ]]&gt;&lt;/title&gt;\r\n&lt;body&gt;\r\n	&lt;![CDATA[\r\n	&lt;eq name=\'body\' value=\'\'&gt; 微博分享 &lt;/eq&gt; \r\n	{$body}\r\n	&lt;dl class=&quot;comment&quot;&gt;\r\n		&lt;dt class=&quot;arrow bgcolor_arrow&quot;&gt;&lt;em class=&quot;arrline&quot;&gt;◆&lt;/em&gt;&lt;span class=&quot;downline&quot;&gt;◆&lt;/span&gt;&lt;/dt&gt;\r\n		&lt;php&gt;if($sourceInfo[\'is_del\'] == 0):&lt;/php&gt;\r\n		&lt;dd class=&quot;name&quot;&gt;\r\n			@{$sourceInfo.source_user_info.uname}\r\n			&lt;volist name=&quot;sourceInfo[\'groupData\'][$sourceInfo[\'source_user_info\'][\'uid\']]&quot; id=&quot;v2&quot;&gt;\r\n				&lt;img style=&quot;width:auto;height:auto;display:inline;cursor:pointer&quot; src=&quot;{$v2[\'user_group_icon_url\']}&quot; title=&quot;{$v2[\'user_group_name\']}&quot; /&gt; \r\n			&lt;/volist&gt;\r\n		&lt;/dd&gt;\r\n		&lt;dd&gt;\r\n			{$sourceInfo.source_content}\r\n			&lt;php&gt;if(!empty($sourceInfo[\'attach\'])):&lt;/php&gt;\r\n			&lt;eq name=\'sourceInfo.feedType\' value=\'postfile\'&gt;\r\n			&lt;ul class=&quot;feed_file_list&quot;&gt;\r\n				&lt;volist name=\'sourceInfo.attach\' id=\'vo\'&gt;\r\n				&lt;li&gt;\r\n					&lt;a href=&quot;{:U(\'widget/Upload/down\',array(\'attach_id\'=&gt;$vo[\'attach_id\']))}&quot; class=&quot;current right&quot; target=&quot;_blank&quot;&gt;&lt;i class=&quot;ico-down&quot;&gt;&lt;/i&gt;&lt;/a&gt;\r\n					&lt;i class=&quot;ico-{$vo.extension}-small&quot;&gt;&lt;/i&gt;\r\n					&lt;a href=&quot;{:U(\'widget/Upload/down\',array(\'attach_id\'=&gt;$vo[\'attach_id\']))}&quot;&gt;{$vo.attach_name}&lt;/a&gt;\r\n					&lt;span class=&quot;tips&quot;&gt;({$vo.size|byte_format})&lt;/span&gt;\r\n				&lt;/li&gt;\r\n				&lt;/volist&gt;			\r\n			&lt;/ul&gt;		\r\n			&lt;/eq&gt;\r\n\r\n			&lt;eq name=\'sourceInfo.feedType\' value=\'postimage\'&gt;\r\n			&lt;div class=&quot;feed_img_lists&quot; rel=\'small\' &gt;\r\n				&lt;ul class=&quot;small&quot;&gt;\r\n					&lt;volist name=\'sourceInfo.attach\' id=\'vo\'&gt;\r\n					&lt;li&gt;&lt;a href=&quot;javascript:void(0)&quot; event-node=\'img_small\'&gt;&lt;img class=&quot;imgicon&quot; src=\'{$vo.attach_small}\' title=\'点击放大\'&gt;&lt;/a&gt;&lt;/li&gt;\r\n					&lt;/volist&gt;\r\n				&lt;/ul&gt;\r\n			&lt;/div&gt;\r\n			&lt;div class=&quot;feed_img_lists&quot; rel=\'big\' style=\'display:none\'&gt;\r\n				&lt;ul class=&quot;feed_img_list big&quot;&gt;\r\n					&lt;p class=\'tools\'&gt;&lt;a href=&quot;javascript:void(0);&quot; event-node=\'img_big\' class=&quot;ico-pack-up&quot;&gt;收起&lt;/a&gt;&lt;/p&gt;\r\n					&lt;volist name=\'sourceInfo.attach\' id=\'vo\'&gt;\r\n					&lt;php&gt;$imgInfo = getThumbImage($vo[\'attach_url\'],425);&lt;/php&gt;\r\n					&lt;li style=&quot;width:{$imgInfo.width}px;&quot; title=\'{$vo[\'attach_url\']}\'&gt;\r\n						&lt;i class=&quot;check-big&quot;&gt;&lt;a href=\'{$vo[\'attach_url\']}\' target=&quot;_blank&quot; class=&quot;ico-show-big&quot; title=&quot;查看大图&quot; &gt;&lt;/a&gt;&lt;/i&gt;\r\n						&lt;a href=&quot;javascript:void(0)&quot; event-node=\'img_big\'&gt;&lt;img class=&quot;imgsmall&quot; src=\'{$imgInfo.src}\' title=\'点击缩小\' /&gt;&lt;/a&gt;\r\n					&lt;/li&gt;\r\n					&lt;/volist&gt;\r\n				&lt;/ul&gt;\r\n			&lt;/div&gt;\r\n			&lt;/eq&gt;	\r\n			&lt;php&gt;endif;&lt;/php&gt;	\r\n		&lt;/dd&gt;\r\n&lt;!--\r\n		&lt;p class=&quot;info&quot;&gt;\r\n			&lt;span class=&quot;right&quot;&gt;\r\n				&lt;a href=&quot;{:U(\'public/Profile/feed\',array(\'uid\'=&gt;$sourceInfo[\'uid\'],\'feed_id\'=&gt;$sourceInfo[\'feed_id\']))}&quot;&gt;原文转发&lt;neq name=&quot;sourceInfo.repost_count&quot; value=&quot;0&quot;&gt;({$sourceInfo.repost_count})&lt;/neq&gt;&lt;/a&gt;&lt;i class=&quot;vline&quot;&gt;|&lt;/i&gt;\r\n				&lt;a href=&quot;{:U(\'public/Profile/feed\',array(\'uid\'=&gt;$sourceInfo[\'uid\'],\'feed_id\'=&gt;$sourceInfo[\'feed_id\']))}&quot;&gt;原文收藏&lt;/a&gt;&lt;i class=&quot;vline&quot;&gt;|&lt;/i&gt;\r\n				&lt;a href=&quot;{:U(\'public/Profile/feed\',array(\'uid\'=&gt;$sourceInfo[\'uid\'],\'feed_id\'=&gt;$sourceInfo[\'feed_id\']))}&quot;&gt;原文评论&lt;neq name=&quot;sourceInfo.comment_count&quot; value=&quot;0&quot;&gt;({$sourceInfo.comment_count})&lt;/neq&gt;&lt;/a&gt;\r\n			&lt;/span&gt;\r\n			&lt;span&gt;&lt;a href=&quot;{:U(\'public/Profile/feed\',array(\'uid\'=&gt;$sourceInfo[\'uid\'],\'feed_id\'=&gt;$sourceInfo[\'feed_id\']))}&quot; class=&quot;date&quot;&gt;{$sourceInfo[\'ctime\']|friendlyDate}&lt;/a&gt;&lt;span&gt;来自网站&lt;/span&gt;&lt;/span&gt;\r\n		&lt;/p&gt;\r\n--&gt;\r\n		&lt;php&gt;else:&lt;/php&gt;\r\n		&lt;dd class=&quot;name&quot;&gt;内容已被删除&lt;/dd&gt;\r\n		&lt;php&gt;endif;&lt;/php&gt;\r\n	&lt;/dl&gt;\r\n	]]&gt;\r\n&lt;/body&gt;\r\n&lt;feedAttr  comment=&quot;true&quot; repost=&quot;true&quot; favor=&quot;true&quot;  delete=&quot;true&quot; /&gt;'),
(6,	'weiba',	'weiba_repost',	'微吧转发',	'	&lt;title&gt; \r\n			&lt;![CDATA[{$actor} ]]&gt;\r\n		&lt;/title&gt;\r\n		&lt;body&gt;\r\n			&lt;![CDATA[\r\n				&lt;eq name=\'body\' value=\'\'&gt; 微博分享 &lt;/eq&gt; \r\n				{$body}\r\n				&lt;dl class=&quot;comment&quot;&gt;&lt;dt class=&quot;arrow bgcolor_arrow&quot;&gt;&lt;em class=&quot;arrline&quot;&gt;◆&lt;/em&gt;&lt;span class=&quot;downline&quot;&gt;◆&lt;/span&gt;&lt;/dt&gt;\r\n				&lt;dd class=&quot;name&quot;&gt;\r\n						&lt;php&gt; if($sourceInfo[\'source_user_info\'][\'uid\'] == $GLOBALS[\'ts\'][\'mid\']){&lt;/php&gt;\r\n					@{$sourceInfo.source_user_info.uname}\r\n					&lt;php&gt; }else{&lt;/php&gt;\r\n					@{$sourceInfo.source_user_info.uname}\r\n					&lt;php&gt; }&lt;/php&gt;\r\n&lt;volist name=&quot;sourceInfo[\'groupData\'][$sourceInfo[\'source_user_info\'][\'uid\']]&quot; id=&quot;v2&quot;&gt;\r\n        				&lt;img style=&quot;width:auto;height:auto;display:inline;cursor:pointer&quot; src=&quot;{$v2[\'user_group_icon_url\']}&quot; title=&quot;{$v2[\'user_group_name\']}&quot; /&gt; \r\n    				&lt;/volist&gt;\r\n				&lt;/dd&gt;\r\n				&lt;dd&gt;\r\n					{$sourceInfo.source_content}\r\n&lt;php&gt;if(APP_NAME == \'public\' || APP_NAME == \'widget\'){&lt;/php&gt;\r\n&lt;a href=&quot;javascript:void(0)&quot; class=&quot;ico-details&quot; event-node =\'loadPost\' event-args=\'feed_id={$feedid}&amp;post_id={$app_row_id}\' id=&quot;{$app_row_id}&quot;&gt;&lt;i class=&quot;triangle-l&quot;&gt;&lt;/i&gt;查看全文&lt;/a&gt;&lt;div class=&quot;feed_img_lists&quot; style=&quot;display:none;&quot; id=&quot;post_{$feedid}_{$app_row_id}&quot;&gt;\r\n&lt;/div&gt;\r\n&lt;php&gt;}else{&lt;/php&gt;\r\n&lt;a href=&quot;{:U(\'weiba/Index/postDetail\',array(\'post_id\'=&gt;$app_row_id))}&quot; class=&quot;ico-details&quot; target=&quot;_blank&quot;&gt;&lt;/a&gt;\r\n&lt;php&gt;}&lt;/php&gt;\r\n					&lt;php&gt;if(!empty($sourceInfo[\'attach\'])):&lt;/php&gt;\r\n					\r\n					&lt;eq name=\'sourceInfo.feedtype\' value=\'postfile\'&gt;\r\n						&lt;ul class=&quot;feed_file_list&quot;&gt;\r\n						&lt;volist name=\'sourceInfo.attach\' id=\'vo\'&gt;\r\n							&lt;li&gt;&lt;a href=&quot;{:U(\'widget/Upload/down\',array(\'attach_id\'=&gt;$vo[\'attach_id\']))}&quot; class=&quot;current right&quot; target=&quot;_blank&quot;&gt;&lt;i class=&quot;ico-down&quot;&gt;&lt;/i&gt;&lt;/a&gt;&lt;i class=&quot;ico-{$vo.extension}-small&quot;&gt;&lt;/i&gt;&lt;a href=&quot;{:U(\'widget/Upload/down\',array(\'attach_id\'=&gt;$vo[\'attach_id\']))}&quot;&gt;\r\n							{$vo.attach_name}&lt;/a&gt; &lt;span class=&quot;tips&quot;&gt;({$vo.size|byte_format})&lt;/span&gt;&lt;/li&gt;\r\n						&lt;/volist&gt;			\r\n						&lt;/ul&gt;		\r\n					&lt;/eq&gt;\r\n\r\n					&lt;eq name=\'sourceInfo.feedtype\' value=\'postimage\'&gt;\r\n					 &lt;div class=&quot;feed_img_lists&quot; rel=\'small\' &gt;\r\n						&lt;ul class=&quot;small&quot;&gt;\r\n						&lt;volist name=\'sourceInfo.attach\' id=\'vo\'&gt;\r\n							&lt;li &gt;&lt;a href=&quot;javascript:void(0)&quot; event-node=\'img_small\'&gt;&lt;img class=&quot;imgicon&quot; src=\'{$vo.attach_small}\' title=\'点击放大\'&gt;&lt;/a&gt;&lt;/li&gt;\r\n						&lt;/volist&gt;\r\n						&lt;/ul&gt;\r\n						&lt;/div&gt;\r\n						&lt;div class=&quot;feed_img_lists&quot; rel=\'big\' style=\'display:none\'&gt;\r\n						&lt;ul class=&quot;feed_img_list big&quot; &gt;\r\n						&lt;p class=\'tools\'&gt;&lt;a href=&quot;javascript:void(0);&quot; event-node=\'img_big\' class=&quot;ico-pack-up&quot;&gt;收起&lt;/a&gt;&lt;/p&gt;\r\n						&lt;volist name=\'sourceInfo.attach\' id=\'vo\'&gt;\r\n							&lt;php&gt; $imgInfo = getThumbImage($vo[\'attach_url\'],425);&lt;/php&gt;\r\n							&lt;li style=&quot;width:{$imgInfo.width}px;&quot; title=\'{$vo[\'attach_url\']}\'&gt;\r\n							&lt;i class=&quot;check-big&quot;&gt;&lt;a href=\'{$vo[\'attach_url\']}\' target=&quot;_blank&quot; class=&quot;ico-show-big&quot; title=&quot;查看大图&quot; &gt;&lt;/a&gt;&lt;/i&gt;\r\n							&lt;a href=&quot;javascript:void(0)&quot; event-node=\'img_big\'&gt;&lt;img class=&quot;imgsmall&quot; src=\'{$imgInfo.src}\' title=\'点击缩小\'&gt;&lt;/a&gt;&lt;/li&gt;\r\n						&lt;/volist&gt;\r\n						&lt;/ul&gt;\r\n						&lt;/div&gt;\r\n					&lt;/eq&gt;	\r\n					&lt;php&gt;endif;&lt;/php&gt;	\r\n				&lt;/dd&gt;&lt;/dl&gt;\r\n			]]&gt;\r\n		&lt;/body&gt;\r\n		&lt;feedAttr  comment=&quot;true&quot; repost=&quot;true&quot; favor=&quot;true&quot;  delete=&quot;true&quot; /&gt;'),
(3,	'public',	'postimage',	'发图片微博',	'		&lt;title&gt; \r\n			&lt;![CDATA[\r\n				{$actor}\r\n			]]&gt;\r\n		&lt;/title&gt;\r\n		&lt;body&gt;\r\n			&lt;![CDATA[ \r\n				{$body}&lt;br/&gt;\r\n				&lt;div class=&quot;feed_img_lists&quot; rel=\'small\' &gt;\r\n				&lt;ul class=&quot;small&quot;&gt;\r\n				&lt;volist name=\'attachInfo\' id=\'vo\'&gt;\r\n					&lt;li &gt;&lt;a href=&quot;javascript:void(0)&quot; event-node=\'img_small\'&gt;\r\n						&lt;img class=&quot;imgicon&quot; src=\'{$vo.attach_small}\' title=\'点击放大\' &gt;&lt;/a&gt;\r\n					&lt;/li&gt; \r\n				&lt;/volist&gt;\r\n				&lt;/ul&gt;\r\n				&lt;/div&gt;\r\n				&lt;div class=&quot;feed_img_lists&quot; rel=\'big\' style=\'display:none\'&gt;\r\n				&lt;ul class=&quot;feed_img_list big&quot; &gt;\r\n				&lt;p class=\'tools\'&gt;&lt;a href=&quot;javascript:void(0)&quot; event-node=\'img_big\' class=&quot;ico-pack-up&quot;&gt;收起&lt;/a&gt;&lt;/p&gt;\r\n				&lt;volist name=\'attachInfo\' id=\'vo\'&gt;\r\n					&lt;li title=\'{$vo.attach_url}\'&gt;\r\n					&lt;i class=&quot;check-big&quot;&gt;&lt;a href=\'{$vo.attach_url}\' target=&quot;_blank&quot; class=&quot;ico-show-big&quot; title=&quot;查看大图&quot; &gt;&lt;/a&gt;&lt;/i&gt;\r\n					&lt;a href=&quot;javascript:void(0)&quot; event-node=\'img_big\'&gt;&lt;img class=&quot;imgsmall&quot; src=\'{$vo.attach_middle}\' title=\'点击缩小\' &gt;&lt;/a&gt;&lt;/li&gt;\r\n				&lt;/volist&gt;\r\n				&lt;/ul&gt;\r\n				&lt;/div&gt;\r\n			 ]]&gt;\r\n		&lt;/body&gt;\r\n		&lt;feedAttr  comment=&quot;true&quot; repost=&quot;true&quot; favor=&quot;true&quot; delete=&quot;true&quot; /&gt;  '),
(4,	'public',	'postfile',	'发附件微博',	'&lt;title&gt; \r\n			&lt;![CDATA[\r\n				{$actor}\r\n			]]&gt;\r\n		&lt;/title&gt;\r\n		&lt;body&gt;\r\n			&lt;![CDATA[ \r\n				{$body}\r\n				&lt;div&gt;\r\n					&lt;ul class=&quot;feed_file_list&quot;&gt;\r\n						&lt;volist name=\'attachInfo\' id=\'vo\'&gt;\r\n							&lt;li&gt;&lt;a href=&quot;{:U(\'widget/Upload/down\',array(\'attach_id\'=&gt;$vo[\'attach_id\']))}&quot; class=&quot;current right&quot; target=&quot;_blank&quot; title=&quot;下载&quot;&gt;&lt;i class=&quot;ico-down&quot;&gt;&lt;/i&gt;&lt;/a&gt;&lt;i class=&quot;ico-{$vo.extension}-small&quot;&gt;&lt;/i&gt;&lt;a href=&quot;{:U(\'widget/Upload/down\',array(\'attach_id\'=&gt;$vo[\'attach_id\']))}&quot;&gt;{$vo.attach_name}&lt;/a&gt; &lt;span class=&quot;tips&quot;&gt;({$vo.size|byte_format})&lt;/span&gt;&lt;/li&gt;\r\n						&lt;/volist&gt;			\r\n						&lt;/ul&gt;\r\n				&lt;/div&gt;\r\n			 ]]&gt;\r\n		&lt;/body&gt;\r\n		&lt;feedAttr  comment=&quot;true&quot; repost=&quot;true&quot; favor=&quot;true&quot;  delete=&quot;true&quot; /&gt;\r\n'),
(5,	'weiba',	'weiba_post',	'微吧原创',	'&lt;title comment=&quot;feed标题&quot;&gt; \r\n			&lt;![CDATA[ {$actor}  ]]&gt;\r\n		&lt;/title&gt;\r\n		&lt;body comment=&quot;feed详细内容/引用的内容&quot;&gt;\r\n			&lt;![CDATA[ {$body}\r\n&lt;php&gt;if(APP_NAME != \'channel\'){&lt;/php&gt;\r\n&lt;a href=&quot;javascript:void(0)&quot; class=&quot;ico-details&quot; event-node =\'loadPost\' event-args=\'feed_id={$feedid}&amp;post_id={$app_row_id}\' id=&quot;{$app_row_id}&quot;&gt;&lt;i class=&quot;triangle-l&quot;&gt;&lt;/i&gt;查看全文&lt;/a&gt;&lt;div class=&quot;feed_img_lists&quot; style=&quot;display:none;&quot; id=&quot;post_{$feedid}_{$app_row_id}&quot;&gt;\r\n&lt;/div&gt;\r\n&lt;php&gt;}else{&lt;/php&gt;\r\n&lt;a href=&quot;{:U(\'weiba/Index/postDetail\',array(\'post_id\'=&gt;$app_row_id))}&quot; class=&quot;ico-details&quot; target=&quot;_blank&quot;&gt;&lt;/a&gt;\r\n&lt;php&gt;}&lt;/php&gt;\r\n ]]&gt;\r\n		&lt;/body&gt;\r\n		&lt;feedAttr  comment=&quot;true&quot; repost=&quot;true&quot; favor=&quot;true&quot;  delete=&quot;true&quot; /&gt; ');
