INSERT INTO `cs_lang` (`lang_id`, `key`, `appname`, `filetype`, `zh-cn`, `en`, `zh-tw`) VALUES
(1,	'NOTIFY_REGISTER_ACTIVE_CONTENT',	'PUBLIC',	0,	'Hi，{name}，欢迎加入 <a href=\"{site_url}\"  style=\"text-decoration:none;color:#3366cc\">{site}</a>，请立即点击下列按钮激活您的帐号。<br /><br />\r\n<a href=\"{activeurl}\" target=\"_blank\" style=\"background:#0F8CA8;padding:5px 10px;color:#fff;text-decoration:none; width:80px;text-align:center;\">激活帐号</a>',	'Hi, {name}, Welcome to {site}, please click the button to activate your account.<br />\r\n<a href=\"{activeurl}\" target=\"_blank\">Click here to activate your account</a>',	'Hi，{name}，歡迎加入{site}，請立即點擊下列按鈕激活您的帳號。<br />\r\n<a href=\"{activeurl}\" target=\"_blank\">點此激活帳號</a>。'),
(2,	'NOTIFY_REGISTER_ACTIVE_TITLE',	'PUBLIC',	0,	'[ {site} ]恭喜您成功注册，请激活您的帐号',	'[{site}] Congratulations,you have successfully registered, please activate your account',	'[ {site} ]恭喜您成功註冊，請激活您的帳號'),
(3,	'NOTIFY_AUDIT_ERROR_CONTENT',	'PUBLIC',	0,	'抱歉，您的帐号注册申请未能通过审核，感谢您对[ {site} ]的支持。若对审核结果有疑问，请联系<a href=\"{kfemail}\" >客服邮箱</a>。',	'Sorry, your account  registered application is not approved, thank you for your support. Any questions, please contact <a href=\"{kfemail}\" >Service mailbox</a> ',	'抱歉，您的帳號註冊申請未能通過審核，感謝您對[ {site} ]的支持。若對審核結果有疑問，請聯繫<a href=\"{kfemail}\" >客服郵箱</a>。'),
(4,	'NOTIFY_AUDIT_ERROR_TITLE',	'PUBLIC',	0,	'[ {site} ]抱歉，您的帐号注册申请被驳回。',	'[{site}] Sorry, your account registration application was rejected.',	'[ {site} ]抱歉，您的帳號註冊申請被駁回。'),
(5,	'NOTIFY_AUDIT_OK_CONTENT',	'PUBLIC',	0,	'Hi，{name}，欢迎加入 {site}，请立即点击下列按钮激活您的帐号。<br /><br />\r\n<a href=\"{activeurl}\" target=\"_blank\" style=\"background:#0F8CA8;padding:5px 10px;color:#fff;text-decoration:none; width:80px;text-align:center;\">点此激活帐号</a>',	'Hi, {name}, Welcome to {site},please click the button to activate your account.<br />\r\n<a href=\"{activeurl}\" target=\"_blank\">Click here to activate your account</a>',	'Hi，{name}，歡迎加入{site}，請立即點擊下列按鈕激活您的帳號。<br />\r\n<a href=\"{activeurl}\" target=\"_blank\">點此激活帳號</a>。'),
(6,	'NOTIFY_AUDIT_OK_TITLE',	'PUBLIC',	0,	'[ {site} ]恭喜您成功注册，请激活您的帐号',	'[{site}] Congratulations,you have successfully registered, please activate your account',	'[ {site} ]恭喜您成功註冊，請激活您的帳號'),
(7,	'NOTIFY_PASSWORD_RESET_CONTENT',	'PUBLIC',	0,	'您刚刚提交了重置密码的申请，请点击下列按钮重置您的登录密码。<br /><br />\r\n<a href=\"{reseturl}\" target=\"_blank\" style=\"background:#0F8CA8;padding:5px 10px;color:#fff;text-decoration:none; width:80px;text-align:center;\">重置密码</a><br /><br />\r\n<font color=\"grey\">若该申请不是由您本人发起，请忽略该邮件。</font>',	'You just submitted applications for resetting your password, please click to reset your login password. \r\n【<a href=\"{reseturl}\" target=\"_blank\">Click here to reset your password</a>】<br />\r\n<font color=\"grey\">If the application is not submitted by yoursel',	'您剛剛提交了重置密碼的申請，請點擊下列按鈕重置您的登錄密碼。<br /> \r\n【<a href=\"{reseturl}\" target=\"_blank\">點此重置密碼</a>】<br />\r\n<font color=\"grey\">若該申請不是由您本人發起，請忽略該郵件。</font>'),
(8,	'NOTIFY_PASSWORD_RESET_TITLE',	'PUBLIC',	0,	'[ {site} ]请重置您的登录密码',	'[{site}] Please reset your login password',	'[ {site} ]請重置您的登錄密碼'),
(9,	'NOTIFY_PASSWORD_SETOK_CONTENT',	'PUBLIC',	0,	'您的密码重置成功，请记住您的新密码。新密码：{newpass}。\r\n<br /><br /><br />\r\n<a href=\"{site_url}\" target=\"_blank\" style=\"text-decoration:none;color:#3366cc\">去网站看看>></a>',	'Your password successfully reset, please remember your new password. New password: {newpass}.<a href=\"{site_url}\" target=\"_blank\">Go to the website>></a>',	'您的密碼重置成功，請記住您的新密碼。新密碼：{newpass}。<a href=\"{site_url}\" target=\"_blank\">去網站看看>></a>'),
(10,	'NOTIFY_PASSWORD_SETOK_TITLE',	'PUBLIC',	0,	'[ {site} ]重置密码成功，请记住您的新密码',	'[{site}] Reset the password successfully, remember your new password',	'[ {site} ]重置密碼成功，請記住您的新密碼'),
(11,	'NOTIFY_USER_LOCK_CONTENT',	'PUBLIC',	0,	'抱歉，由于您的密码输入错误超过6次，为了您的帐号安全，系统已将您的帐号暂时锁定，一小时后自动解锁，届时您可正常登录。',	'Sorry, your account have tried to login with your password too many times, for your account security, the system has temporarily locked your account and it will unlocked automatically after one hour, then you can login normally.',	'抱歉，由於您的密碼輸入次數過多，為了您的帳號安全，系統已將您的帳號暫時鎖定，一小時後自動解鎖，屆時您可正常登錄。'),
(12,	'NOTIFY_USER_LOCK_TITLE',	'PUBLIC',	0,	'[ {site} ]抱歉，您的帐号暂时被锁定',	'[{site}] Sorry, your account has been temporarily locked',	'[ {site} ]抱歉，您的帳號暫時被鎖定'),
(13,	'NOTIFY_ATME_CONTENT',	'PUBLIC',	0,	'您的好友 <a href=\"{space_url}\" target=\'_blank\' style=\"text-decoration:none;color:#3366cc;\">{name}</a> 刚刚在以下内容中提到了你：<br /><table style=\"width:480px;background:#eee;padding:10px\"><tbody><tr><td style=\"width:50px;float:left;margin-right:10px\"><img src=\"{face}\"></td><td style=\"font-size:12px;width:420px\"><div style=\"padding:0;margin:0\"><a href=\"{space_url}\" target=\'_blank\' style=\"text-decoration:none;color:#3366cc;\">{name}</a>:</div><div style=\"padding:0;margin:0\">{content}</div><div style=\"padding:0;margin:0\"><span style=\"float:right\"><a href=\"{feed_url}\" style=\"text-decoration:none;color:#3366cc\">收藏</a>｜<a href=\"{feed_url}\" style=\"text-decoration:none;color:#3366cc\">转发</a>｜<a href=\"{feed_url}\" style=\"text-decoration:none;color:#3366cc\">评论</a></span><span>{publish_time}   来自  网站</span></div></td></tr></tbody></table><br />',	'Your colleagues {name} just mentioned you in the following content: {content}.<a href=\"{site_url}\" target=\"_blank\">Go to the website>></a>',	'您的好友 {name} 剛剛在以下內容中提到了你：{content}。<a href=\"{site_url}\" target=\"_blank\">去網站看看>></a>'),
(14,	'NOTIFY_ATME_TITLE',	'PUBLIC',	0,	'[ {site} ]{name}刚刚提到了您',	'[{site}] {name} just mentioned you',	'[ {site} ] {name} 剛剛提到了您'),
(15,	'NOTIFY_COMMENT_CONTENT',	'PUBLIC',	0,	'您收到了新的评论<br /><table style=\"width:480px;background:#eee;padding:10px\"><tbody><tr><td style=\"width:50px;float:left;margin-right:10px\"><img src=\"{face}\"></td><td style=\"font-size:12px;width:420px\"><div style=\"padding:0;margin:0\"><a href=\"{space_url}\" target=\'_blank\' style=\"text-decoration:none;color:#3366cc;\">{name}</a>:{content} ({ctime})</div><div style=\"padding:0;margin:0\">{comment_type}{source_content}</div><div style=\"padding:0;margin:0\"><span style=\"float:right\"><a href=\"{sourceurl}\" style=\"text-decoration:none;color:#3366cc\">查看原微博</a>｜<a href=\"{sourceurl}\" style=\"text-decoration:none;color:#3366cc\">回复</a></span><span>{source_ctime}   来自  网站</span></div></td></tr></tbody></table><br />',	'You received a new comment {content}. <a href=\"{sourceurl}\" target=\'_blank\'>Go to the website>></a>.',	'您收到了新的評論：{content}。<a href=\"{sourceurl}\" target=\'_blank\'>去網站看看>></a>'),
(16,	'NOTIFY_COMMENT_TITLE',	'PUBLIC',	0,	'[ {site} ]您收到了新的评论',	'[{site}] You received a new comment',	'[ {site} ]您收到了新的評論'),
(17,	'NOTIFY_NEW_MESSAGE_CONTENT',	'PUBLIC',	0,	'您收到1封新的私信<br /><table style=\"width:480px;background:#eee;padding:10px\"><tbody><tr><td style=\"width:50px;float:left;margin-right:10px\"><img src=\"{face}\"></td><td style=\"font-size:12px;width:420px\"><div style=\"padding:0;margin:0\"><a href=\"{space_url}\" target=\'_blank\' style=\"text-decoration:none;color:#3366cc;\">{name}</a>:{content}</div><div style=\"padding:0;margin:0\"><span style=\"float:right\"><a href=\"{source_url}\" style=\"text-decoration:none;color:#3366cc\">共1条私信</a>｜<a href=\"{source_url}\" style=\"text-decoration:none;color:#3366cc\">回复</a></span><span>{ctime}</span></div></td></tr></tbody></table><br />',	'You received a new private message.{content}.<a href=\"{site_url}\" target=\"_blank\">Go to the website>></a>',	'您收到1封新的私信：{content}。<a href=\"{site_url}\" target=\"_blank\">去網站看看>></a>'),
(18,	'NOTIFY_NEW_MESSAGE_TITLE',	'PUBLIC',	0,	'[ {site} ]您收到1封新的私信',	'[{site}]You received a new private message',	'[{site} ]您收到1封新的私信'),
(19,	'NOTIFY_SHARE_USER_CONTENT',	'PUBLIC',	0,	'您的好友 {name} 给您转发了内容：【{content}】快去<a href=\"{sourceurl}\" target=\"_blank\">看看</a>吧。',	'Your friend {name} shared [{content}] with you ,<a href=\"{sourceurl}\" target=\'_blank\'> go and see it</a>.',	'您的好友 {name} 給您轉發了內容：【{content}】，快去<a href=\"{sourceurl}\" target=\'_blank\'>看看</a>吧。'),
(20,	'NOTIFY_SHARE_USER_TITLE',	'PUBLIC',	0,	'[ {site} ]您收到1条新的转发',	'[{site}] You received a new share',	'[ {site} ]您收到1條新的轉發'),
(21,	'NOTIFY_REGISTER_INVATE_CONTENT',	'PUBLIC',	0,	'您的好友 <a href=\"{space_url}\" target=\'_blank\' style=\"text-decoration:none;color:#3366cc;\">{name}</a> 邀请您加入<a href=\"{site_url}\" style=\"text-decoration:none;color:#3366cc;\"> {site}</a><br /><br /><table style=\"background:#eee;padding:10px\"><tbody><tr><td style=\"width:50px;float:left;\"><img src=\"{face}\"></td><td style=\"font-size:12px;padding:0 0 0 10px;\">{content}</td></tr></tbody></table><br /><a href=\"{invateurl}\" target=\"_blank\" style=\"background:#0f8ca8;width:80px;display:block;padding:5px 10px;color:#fff;text-align:center;font-size:12px;text-decoration:none;\">接受邀请</a>',	'Your friend {name} invited you to join {site} , he/she say：{content} [<a href=\"{invateurl}\" target=\"_blank\">Accept Invitation</a>]',	'您的好友 {name} 邀請您加入 {site}，TA說“{content}”【<a href=\"{invateurl}\" target=\"_blank\">接受邀請</a>】'),
(22,	'NOTIFY_REGISTER_INVATE_TITLE',	'PUBLIC',	0,	'[ {site} ]您的好友 {name} 邀请您注册网站',	'[{site}] Your friend {name} invited you register for the site',	'[ {site} ]您的好友 {name} 邀請您註冊網站'),
(23,	'NOTIFY_REGISTER_INVATE_OK_CONTENT',	'PUBLIC',	0,	'您的好友 <a href=\"{space_url}\" target=\'_blank\' style=\"text-decoration:none;color:#3366cc;\">{name}</a> 刚刚注册开通了帐号，系统已经自动为你们互相关注，快去<a href=\"{space_url}\" target=\"_blank\">TA的主页</a>看看吧。',	' You friend {name} has just opened the account, the system has automatically mutual concern for you, go and say hello with TA. <a href=\"{spaceurl}\" target=\"_blank\">Go to his/her home page >></a>',	'您邀請的好友 {name} 剛剛註冊開通了帳號，系統已經自動為你們互相關注，快去跟TA打聲招呼吧。<a href=\"{spaceurl}\" target=\"_blank\">去TA的主頁看看>></a>'),
(24,	'NOTIFY_REGISTER_INVATE_OK_TITLE',	'PUBLIC',	0,	'[ {site} ]您的好友 {name} 开通了帐号',	'[{site}] Your friend {name} opened the account',	'[ {site} ]您的好友 {name} 開通了帳號'),
(25,	'NOTIFY_TASK_TODO_CONTENT',	'PUBLIC',	0,	'您的好友 {name} 给您指派了一条任务【{taskname}】，<a href=\"{taskurl}\" target=\"_blank\">点击这里查看详情</a>。',	'Your friend {name} assigned a task [{taskname}] to you, <a href=\"{taskurl}\" target=\"_blank\">click here for details</a>.',	'您的好友{name}給您指派了一條任務【{taskname}】，<a href=\"{taskurl}\" target=\"_blank\">點擊這裡查看詳情</a>。'),
(26,	'NOTIFY_TASK_TODO_TITLE',	'PUBLIC',	0,	'[{site}]您收到了一条新的指派任务',	'[{site}] You received a new assigned task',	'[{site}]您收到了一條新的指派任務'),
(27,	'NOTIFY_TASK_SHARE_CATEGORY_CONTENT',	'PUBLIC',	0,	'您的好友{site}共享了一个任务分类【{taskcate}】给您，<a href=\"{mytaskurl}\" target=\"_blank\">点击这里查看详情</a>。',	'Your friend {name}  shared a task category [{taskcate}] with you . <a href=\"{mytaskurl}\" target=\"_blank\">Click here for details</>.',	'您的好友{name}給您共享了一個任務分類【{taskcate}】，<a href=\"{mytaskurl}\" target=\"_blank\">點擊這裡查看詳情</a>。'),
(28,	'NOTIFY_TASK_SHARE_CATEGORY_TITLE',	'PUBLIC',	0,	'[{site}]您的好友{name}共享了一个任务分类给您',	'[{site}] Your colleague {name} shared a task category with you',	'[{site}]您收到了一個任務分類的共享'),
(29,	'NOTIFY_ASK_ANSWEME_CONTENT',	'PUBLIC',	0,	'您收到了新的回答：{content}',	'You received a new comment.{content}',	'您收到了新的回答：{content}'),
(30,	'NOTIFY_ASK_ANSWEME_TITLE',	'PUBLIC',	0,	'[ {site} ]您收到了新的回答',	'[{site}] You received a new comment',	'[ {site} ]您收到了新的回答'),
(31,	'NOTIFY_ASK_STATUS_CHANGE_CONTENT',	'PUBLIC',	0,	'您发起的问题【{askname}】状态由【{oldstatus}】改成【{newstatus}】，点击这里<a href=\"{askurl}\" target=\"_blank\"> 查看详情</a>',	'The state of your question [{askname}] has  changed from [{oldstatus}] to [{newstatus}], <a href=\"{askurl}\" target=\"_blank\">click here for details</a>',	'您發起的問題【{askname}】狀態由【{oldstatus}】改成【{newstatus}】，點擊這裡<a href=\"{askurl}\" target=\"_blank\">查看詳情</a>'),
(32,	'NOTIFY_ASK_STATUS_CHANGE_TITLE',	'PUBLIC',	0,	'[ {site} ]您发起的问题状态已改变',	'[{site}] The state of your question has changed',	'[ {site} ]您發起的問題狀態已改變'),
(33,	'NOTIFY_ASK_SETDIST_CONTENT',	'PUBLIC',	0,	'您发起的问题【{askname}】被管理员设为精华知识，点击这里<a href=\"{asklink}\" target=\"_blank\">查看详情</a>',	'Your question [{askname}] is set as essence knowledge, <a href=\"{asklink}\" target=\"_blank\">click here for details</a>',	'您發起的問題【{askname}】被管理員設為精華知識，點擊這裡<a href=\"{asklink}\" target=\"_blank\">查看詳情</a>'),
(34,	'NOTIFY_ASK_SETDIST_TITLE',	'PUBLIC',	0,	'[ {site} ]您发起的问题被管理员设为精华知识',	'[{site}] Your question is set as essence knowledge',	'[ {site} ]您發起的問題被管理員設為精華知識'),
(35,	'NOTIFY_ASK_ANSWER_SHARE_CONTENT',	'PUBLIC',	0,	'您的好友 {name} 刚刚在以下内容中提到了你：{content}',	'Your friend {name} just mentioned you in the following content: {content}',	'您的好友 {name} 剛剛在以下內容中@提到了你：{content}'),
(36,	'NOTIFY_ASK_ANSWER_SHARE_TITLE',	'PUBLIC',	0,	'[ {site} ] {name} 刚刚提到了您',	'[{site}] {name} just mentioned you',	'[ {site} ] {name} 剛剛提到了您'),
(37,	'NOTIFY_ASK_COMMENT_CONTENT',	'PUBLIC',	0,	'您收到了新的评论：{content}',	'You received a new comment : {content}',	'您收到了新的評論：{content}'),
(38,	'NOTIFY_ASK_COMMENT_TITLE',	'PUBLIC',	0,	'[ {site} ]您收到了新的评论',	'[{site}] You received a new comment',	'[ {site} ]您收到了新的評論'),
(39,	'NOTIFY_ASK_BEST_ANSWER_CONTENT',	'PUBLIC',	0,	'您在问题【{asktitle}】下的回复被设为最佳答案，获得{gold}财富值，点击这里<a href=\"{askurl}\" target=\"_blank\">查看详情</a>',	'Your reply for question [{asktitle}] is set as the best answer and you can get  {gold} wealth, <a href=\"{askurl}\" target=\"_blank\">click here for details</a>',	'您在問題【{asktitle}】下的回復被設為最佳答案，獲得{gold}財富值，點擊這裡<a href=\"{askurl}\" target=\"_blank\">查看詳情</a>'),
(40,	'NOTIFY_ASK_BEST_ANSWER_TITLE',	'PUBLIC',	0,	'[ {site} ]您的回复被设为最佳答案',	'[{site}] Your reply is set as best answer',	'[ {site} ]您的回復被設為最佳答案'),
(41,	'NOTIFY_ASK_INVATE_CONTENT',	'PUBLIC',	0,	'{name}发起了一个问题【{asktitle}】，邀请您回答，点击这里<a href=\"{askurl}\" target=\"_blank\">查看详情</a>',	'{name} submitted a question [{asktitle}] and invite you to answer, <a href=\"{askurl}\" target=\"_blank\">click here for details</a>.',	'{name}發起了一個問題【{asktitle}】，邀請您回答，點擊這裡<a href=\"{askurl}\" target=\"_blank\">查看詳情</a>'),
(42,	'NOTIFY_ASK_INVATE_TITLE',	'PUBLIC',	0,	'[ {site} ]您收到了一个新问题',	'[{site}] You received a new problem',	'[ {site} ]您收到了一個新問題'),
