(1,	1,	'嵌入式系统',	2,	1,	420500,	420000,	420502,	'三峡大学',	1395579211,	1403354978,	'嵌入式系统',	'15672483581',	0,	'2014/0323/20/532ed94b4bf7a.jpg',	'借用',	NULL,	NULL,	NULL,	NULL,	0,	NULL),
(2,	2,	'活着',	2,	1,	NULL,	0,	NULL,	'三大11',	1396618310,	1404394266,	'<p style=\"text-indent:2em;color:#111111;font-family:Helvetica, Arial, sans-serif;\">\r\n	地主少爷富贵嗜赌成性，终于赌光了家业一贫如洗，穷困之中的富贵因为母亲生病前去求医，没想到半路上被国民党部队抓了壮丁，后被解放军所俘虏，回到家乡他才知道母亲已经去世，妻子家珍含辛茹苦带大了一双儿女，但女儿不幸变成了聋哑人，儿子机灵活泼……\r\n</p>\r\n<p style=\"text-indent:2em;color:#111111;font-family:Helvetica, Arial, sans-serif;\">\r\n	然而，真正的悲剧从此才开始渐次上演，每读一页，都让我们止不住泪湿双眼，因为生命里难得的温情将被一次次死亡撕扯得粉碎，只剩得老了的富贵伴随着一头老牛在阳光下回忆。\r\n</p>',	'15672483581',	0,	'2014/0404/21/533eb446bc47d.jpg',	'12',	NULL,	NULL,	NULL,	NULL,	0,	88),
(3,	4,	'拼车',	0,	1,	NULL,	NULL,	NULL,	'三峡大学欣苑',	1396697456,	1404473414,	'拼车回家',	'15672483581',	0,	'2014/0405/19/533fe97048f51.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	0,	89),
