(1,	'微校园发布',	1,	1399638461,	1,	'<p>\r\n	<span style=\"line-height:1.5;\">校园达人是为高校学生量身制作的在线校园社交平台，通过手机</span><span style=\"line-height:1.5;\">App</span><span style=\"line-height:1.5;\">、微信公众平台和</span><span style=\"line-height:1.5;\">Web</span><span style=\"line-height:1.5;\">站点为学生提供学习、生活、社交等信息化服务，凭借服务积累大量的稳定的用户，以吸引商家入驻作为最终盈利模式。</span> \r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<h2>\r\n	<strong>图书馆助手</strong> \r\n</h2>\r\n<p class=\"p0\">\r\n	提供图书馆馆藏信息移动查询功能，用户可随时随地查询图书馆内的书籍借阅、新书动态，同时还可在借阅书籍超期之前的一段时间内将还书提醒发送到用户移动端，有效避免因疏忽遗忘造成的超期现象。\r\n</p>\r\n<p class=\"p0\">\r\n	后期预计添加图书馆自习座位空闲状态的查看，并推出预测功能，即覆盖全天时段的人数预测曲线，为学生寻找自习座位提供便利。\r\n</p>\r\n<h2>\r\n	<strong>失误招领</strong> \r\n</h2>\r\n<p class=\"p0\">\r\n	提供失物招领和寻物启事的平台，提供学校范围的失物招领和寻物启事服务。失主在平台上提交寻物启事（寻物启事可由用户自行取消或删除），其中包括一些列描述性信息或图片；拾到失物的用户在另一版块中提交拾到的物品的相关信息，然后由系统将自动给可能的失主推送消息（若失主已经撤销寻物启事，则系统不会给该失主推送相关失物招领信息），由失主自行与拾到失物的用户线下完成“完璧归赵”过程。\r\n</p>\r\n<h2>\r\n	<strong>买卖版块</strong> \r\n</h2>\r\n<p class=\"p0\">\r\n	该版块主要为学生校内学生提供一个买卖信息的平台，通过发布信息和浏览，结合线下交易，完成校内各类资源交换。\r\n</p>\r\n<h2>\r\n	<strong>其他版块</strong> \r\n</h2>\r\n<p class=\"p0\">\r\n	本项目中还包括校内资讯、找人、投票等功能，同时还有一系列正在开发的应用，如娱乐游戏、班务管理、水电缴费等。\r\n</p>\r\n<span><span style=\"line-height:27px;\"><b>创新性</b></span></span><br />\r\n<p class=\"p0\">\r\n	<span style=\"line-height:1.5;\">    本平台服务于大学生，欲打造一个基于社交的在线校园服务平台，方便大学生的校园生活，如果得到学校的推广支持，全校师生使用，其下载量是相当可观的。我们的目标市场是全国各高校，前期我们搭建一个可拓展功能的服务平台，为各高校开放接口，待应用在本校使用成熟以后即可推入其他高校，每个高校可设置代理机构从事平台的运营。</span> \r\n</p>\r\n<p class=\"p0\">\r\n	<span style=\"line-height:1.5;\">    在技术、理念、创意以及产品推广营销等方面的独创性和领先性。</span> \r\n</p>\r\n<p class=\"p0\" style=\"text-indent:21pt;\">\r\n	（<span>1</span><span>）混合模式移动应用（</span><span>Hybierd App</span><span>），介于</span><span>web-app</span><span>、</span><span>native-app</span><span>这两者之间的</span><span>app</span><span>，兼具“</span><span>Native App</span><span>良好用户交互体验的优势”和“</span><span>Web App</span><span>跨平台开发的优势”，降低开发成本。</span> \r\n</p>\r\n<p class=\"p0\" style=\"text-indent:21pt;\">\r\n	（<span>2</span><span>）基于微博社交的互动分享，所有功能与社交联系起来，增加用户的粘性和趣味性。</span> \r\n</p>\r\n<p class=\"p0\" style=\"text-indent:21pt;\">\r\n	（<span>3</span><span>）增强消息订阅和消息推送，为了更方便的提醒用户，用户可以对失物招领、水电费缴费、图书馆借还、课程表提醒，校园重大通知、兼职提示等消息进行订阅，并及时推送提醒。</span> \r\n</p>\r\n<p class=\"p0\" style=\"text-indent:21pt;\">\r\n	（<span>4</span><span>）功能定制，平台内的各个功能可以自由定制，自由安装卸载，实时同步。</span> \r\n</p>\r\n<p class=\"p0\" style=\"text-indent:21pt;\">\r\n	（<span>5</span><span>）开放接口，插件，功能可自由嵌入，有兴趣的学生或者组织都可以为平台开发插件或者增加功能。</span> \r\n</p>\r\n<p class=\"p0\" style=\"text-indent:21pt;\">\r\n	（<span>6</span><span>）平台互通，接入微信，消息可同步到各设社交平台，利于推广，提升用户体验。</span> \r\n</p>\r\n<p class=\"p0\" style=\"text-indent:21pt;\">\r\n	3<span>、可拓展性：后续研发、推出系列产品的可能性和路径设计。 </span> \r\n</p>\r\n<p class=\"p0\" style=\"text-indent:21pt;\">\r\n	（<span>1</span><span>）平台开放接口，各功能采用插件和模块式开发，后期可以不断添加新功能，新特性。</span> \r\n</p>\r\n<p class=\"p0\" style=\"text-indent:21pt;\">\r\n	（<span>2</span><span>）后续加入微店平台进行盈利，当用户依赖我们的平台用户量达到一定规模，我们即可拓展盈利产品。</span> \r\n</p>\r\n<p class=\"p0\" style=\"text-indent:21pt;\">\r\n	（<span>3</span><span>）路径设计：微校园</span><span>-></span><span>校园微店</span><span>o2o-></span><span>商家微信公众平台</span><span>-></span><span>可定制小型</span><span>ERP-></span><span>数据分析平台</span><span>-></span><span>兴趣智能推送平台。</span> \r\n</p>\r\n<p class=\"p0\" style=\"text-indent:21pt;\">\r\n	<span><img src=\"/data/upload/2014/0509/20/536cc91d33eab.png\" alt=\"\" /><br />\r\n</span> \r\n</p>\r\n<p class=\"p0\" style=\"text-indent:21pt;\">\r\n	<img src=\"/data/upload/2014/0509/20/536cc92fd028c.png\" alt=\"\" /> \r\n</p>\r\n<p class=\"p0\" style=\"text-indent:21pt;\">\r\n	<br />\r\n</p>\r\n<p class=\"p0\" style=\"text-indent:21pt;\">\r\n	<img src=\"/data/upload/2014/0509/20/536cc93da7013.png\" alt=\"\" /><img src=\"/data/upload/2014/0509/20/536cc94986616.png\" alt=\"\" /><img src=\"/data/upload/2014/0509/20/536cc951ccc89.png\" alt=\"\" /> \r\n</p>\r\n<span style=\"line-height:1.5;\"></span> \r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>',	'',	1);
