DROP TABLE IF EXISTS `cs_group_tag`;
CREATE TABLE `cs_group_tag` (
  `group_tag_id` int(11) NOT NULL AUTO_INCREMENT,
  `gid` int(11) NOT NULL,
  `tag_id` int(11) NOT NULL,
